import React from 'react';
import './Whatsapp.css';



var message = {
    messages: [
        {
            "source": "sender",
            "message": "another"
        },
        {
            "source": "receiver",
            "message": "Hi"
        }
    ]
}
function Whatsapp() {
    return (
        <div className="container">
            <TopBar />
            <ChatContainer />
        </div>
    );
}

function TopBar() {
    return (
        <div className="top-bar">
            <div className="back">
                <i class="zmdi zmdi-arrow-left zmdi-hc-2x"></i>
            </div>
            <div className="avatar">
                <img src="https://res.cloudinary.com/onlinesales/image/upload/w_32,f_auto,q_auto/logos/OnlineSales.ai_Logo.svg" alt="profile-picutre"></img>
            </div>
            <div className="user-name">Online Sales</div>

            <div class="actions">
                <i class="zmdi zmdi-more-vert zmdi-hc-2x"></i>
            </div>
        </div>
    );
}

function ChatContainer() {
    return (
        <div className="chat-container">
            <div className="message clearfix">
                <div className={message.messages[0].source}>
                    <div>{message.messages[0].message}</div>
                    <span className="time">3:30 PM</span>
                    <span className="tick"><svg xmlns="http://www.w3.org/2000/svg" width="16" height="15" id="msg-dblcheck-ack" x="2063" y="2076"><path d="M15.01 3.316l-.478-.372a.365.365 0 0 0-.51.063L8.666 9.88a.32.32 0 0 1-.484.032l-.358-.325a.32.32 0 0 0-.484.032l-.378.48a.418.418 0 0 0 .036.54l1.32 1.267a.32.32 0 0 0 .484-.034l6.272-8.048a.366.366 0 0 0-.064-.512zm-4.1 0l-.478-.372a.365.365 0 0 0-.51.063L4.566 9.88a.32.32 0 0 1-.484.032L1.892 7.77a.366.366 0 0 0-.516.005l-.423.433a.364.364 0 0 0 .006.514l3.255 3.185a.32.32 0 0 0 .484-.033l6.272-8.048a.365.365 0 0 0-.063-.51z" fill="#4fc3f7" /></svg></span>
                </div>

            </div>
            <div className="message clearfix">
                <div className="message-recieved">
                    <div>Hello, Welcome to online sales. How can we help you?</div>
                    <span className="time">3:30 PM</span>
                    <span className="tick"><svg xmlns="http://www.w3.org/2000/svg" width="16" height="15" id="msg-dblcheck-ack" x="2063" y="2076"><path d="M15.01 3.316l-.478-.372a.365.365 0 0 0-.51.063L8.666 9.88a.32.32 0 0 1-.484.032l-.358-.325a.32.32 0 0 0-.484.032l-.378.48a.418.418 0 0 0 .036.54l1.32 1.267a.32.32 0 0 0 .484-.034l6.272-8.048a.366.366 0 0 0-.064-.512zm-4.1 0l-.478-.372a.365.365 0 0 0-.51.063L4.566 9.88a.32.32 0 0 1-.484.032L1.892 7.77a.366.366 0 0 0-.516.005l-.423.433a.364.364 0 0 0 .006.514l3.255 3.185a.32.32 0 0 0 .484-.033l6.272-8.048a.365.365 0 0 0-.063-.51z" fill="#4fc3f7" /></svg></span>
                </div>
            </div>

            <div className="message clearfix">
                <div className="message-sent">
                    <div>I am planning to launch a facebook campaign</div>
                    <span className="time">3:30 PM</span>
                    <span className="tick"><svg xmlns="http://www.w3.org/2000/svg" width="16" height="15" id="msg-dblcheck-ack" x="2063" y="2076"><path d="M15.01 3.316l-.478-.372a.365.365 0 0 0-.51.063L8.666 9.88a.32.32 0 0 1-.484.032l-.358-.325a.32.32 0 0 0-.484.032l-.378.48a.418.418 0 0 0 .036.54l1.32 1.267a.32.32 0 0 0 .484-.034l6.272-8.048a.366.366 0 0 0-.064-.512zm-4.1 0l-.478-.372a.365.365 0 0 0-.51.063L4.566 9.88a.32.32 0 0 1-.484.032L1.892 7.77a.366.366 0 0 0-.516.005l-.423.433a.364.364 0 0 0 .006.514l3.255 3.185a.32.32 0 0 0 .484-.033l6.272-8.048a.365.365 0 0 0-.063-.51z" fill="#4fc3f7" /></svg></span>
                </div>
            </div>


            <div className="message-compose">
                <div className="input-field">
                    <div className="smiley">
                        <i class="zmdi zmdi-mood"></i>
                    </div>

                    <div className="message-type">
                        <span>Type a message</span>
                    </div>

                    <div className="camera-icon">
                        <i className="zmdi zmdi-camera"></i>
                    </div>
                </div>

                <div className="send-button">
                    <i class="zmdi zmdi-mail-send"></i>
                </div>

            </div>

        </div>
    );
}

export default Whatsapp;
